// attempt1: description on the algorithm
let dp = (s, minJump, maxJump) => {
    // Special cases
    if (!s) return false;
    if (s.length == 0) return false;
    if (minJump == 0) return false;
    if (s[s.length-1] != '0') return false;

    let cache = [];
    return dp_recursive(s, minJump, maxJump, 0, cache);
};

let dp_recursive = (s, minJump, maxJump, position, cache) => {
    //console.log(`[${position}]----`);

    // Special cases
    // If position isn't in s
    if (position < 0 || position >= s.length) {
        cache[position] = false;
        //console.log(`  A [${position}] = ${cache[position]}.  not in s; dead end.`);
        return cache[position];
    }

    // If position is the target (last item in s)
    if (position == s.length-1) {
        cache[position] = true;
        //console.log(`  B [${position}] = ${cache[position]}.  found target.`);
        return cache[position];
    }

    // If s[position] isn't 0
    if (s[position] != '0') {
        cache[position] = false;
        //console.log(`  C [${position}] = ${cache[position]}.  ${s[position]}!=0; dead end.`);
        return cache[position];
    }

    cache[position] = false;
    for (let j=Math.min(maxJump,(s.length-1)-position); j>=minJump; j--) {
        cache[position] = cache[position] || dp_recursive(s, minJump, maxJump, position+j, cache)

        if (cache[position] == true) {
            //console.log(`  D [${position}] = ${cache[position]}`);
            return cache[position];
        }
    }

    //console.log(`  E [${position}] = ${cache[position]}`);
    return cache[position];
};

